function App() {
  return (
    <div className="App">


      <div className="container-fluid" style={{height:'100vh'}}>
          <div className="row h-100">
              <div className="col-md-3 bg-dark">
                <button type="button" class="btn btn-info btn-block">Info</button>
              </div>
              <div className="col-md-9 bg-light">

              </div>
          </div>
      </div>


    </div>
  );
}

export default App;
